import ReactDOM from 'react-dom';
import { BrowserRouter } from 'react-router-dom'; // new import

import App from './App';
import './index.css';

const rootElement = document.getElementById('root');
const root = ReactDOM.createRoot(rootElement); // added ReactDOM before createRoot

root.render(
  <BrowserRouter>
    <App />
  </BrowserRouter>
);
